import React from 'react'
import { Link } from '../routes'

const SmallNavContrainer = ({}) => (
    <div>
        <style jsx>{` 
            h3 {
                color: #393939;
                font-size: 18px;
                font-weight: 500;
                line-height: 1.2em;
                margin-bottom: 8px;
                margin-top: 0;
            }
            li {
                border: none;
                color: #717171;
                display: block;
                font-size: 14px;
                padding: 4px 0;
                -webkit-transition: color .3s;
                transition: color .3s;
            }
            li::before{
                content: "- "
            }
            ul {
                padding: 0 8px;
            }
            
            
        `}</style>
        <h3>Diensten</h3>
        <ul className="list-group list-group-flush">
            <li className="list-group-item">
                <Link route='services.webshops'>
                    <a>Webshop</a>
                </Link>
            </li>
            <li className="list-group-item">
                <Link route='services.webshop'>
                    <a>Webshop</a>
                </Link>
            </li>
        </ul>

    </div>
)

export default SmallNavContrainer
